import React from 'react';
import Input from './field/input';

const Question2 = ({data, onChange}) => {
  return (
    <div>
      <h1 className="question">Question 2</h1>
      <p>Explain to yourself why you want to transmute into the Vision of yourself you just described. Give 3 reasons.</p>
      <ol>
        <li><Input id="purpose1" type="text" n={1} onChange={onChange}/></li>
        <li><Input id="purpose2" type="text" n={2} onChange={onChange}/></li>
        <li><Input id="purpose3" type="text" n={3} onChange={onChange}/></li>
      </ol>
    </div>
  );
}

export default Question2;
